import React, { Component, Suspense } from 'react';
import PropTypes from 'prop-types';
//import classNames from 'classnames';
//import * as router from 'react-router-dom';
import {
  CSidebar,
  CSidebarBrand,
  CSidebarNav,
  CSidebarNavDivider,
  CSidebarNavTitle,
  CNavItem,
  CProgress,
  CSidebarMinimizer
} from '@coreui/react';

// import { CIcon } from '@coreui/icons-react';

//logo
// import logo from '../../../assets/coreui/img/brand/coreui-react-pro-neg.svg'
// import sygnet from '../../../assets/coreui/img/brand/coreui-signet.svg'
import logo from '../../../assets/images/logo.png'
import logo_small from '../../../assets/images/logo_small.png'


// sidebar nav config
import navigation from '../../../_nav';

class DefaultSidebar extends Component {

  constructor(props) {
    super(props);

    this.state = {
      activeTab: '1',
      minimize: props.sidebarMinimize,
      k: 2
    };
    this.lastSidebarMinimize = props.sidebarMinimize;
  }

  render() {

    const {
      sidebarShow,
      sidebarMinimize,
      onChange,
      location
    } = this.props;

    /*
    const classesSidebar = classNames(
    'c-sidebar-dark'
    );
    */

    if (sidebarMinimize!==this.lastSidebarMinimize){
      this.setState({minimize: sidebarMinimize});
      this.lastSidebarMinimize = sidebarMinimize;
    }

    return (
      <CSidebar
        show={sidebarShow}
        unfoldable
        minimize={this.state.minimize}
        onShowUpdate={onChange}
      >
        <CSidebarBrand
          imgFull={{ width: 118, height: 46, alt: 'Logo', src: logo}}
          imgMinimized={{ width: 118, height: 46, alt: 'Logo', src: logo}}
          linkProps={{ href: 'https://coreui.io/', target: '_blank'}}
        />

        {/* <Suspense>
          <CSidebarNav navConfig={navigation} location={location}>
