            </CNavItem>
          </CSidebarNav>
        </Suspense> */}
        <CSidebarMinimizer className="c-d-md-down-none" onClick={()=>{this.setState({minimize: !this.state.minimize})}} />
      </CSidebar>
    );
  }
}

